import './App.css';
import React from 'react';

function App() {
  const [data, setData] = React.useState(0);

  function getQuote() {
    fetch('https://api.quotable.io/random')
      .then(response => response.json())
      .then(data => setData(data.content));
  }


  return (
    <div className="App">
      <header className="App-header">


        <h3>{data}</h3>

      </header>
    </div>
  );
}

export default App;
